import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';
import logo   from '../picon.ico';
import styled from 'styled-components';
import { Butt } from './Butt';
import { Navs } from './Navs';
import { FaAlignRight} from 'react-icons/fa'


export default class Navi extends Component {
	render() {
		{/*
        https://www.iconfinder.com/icons/10496/poll_icon */}

		return (
			<Navs className="navbar sticky-top navbar-expand-sm px-sm-5">

				<NavLink to="/">
					<img src={logo} alt="Poll" className="navbar-brand" />
				</NavLink>

				<ul className="navbar-nav align-items-center">
					<li className="nav-item ml-5">
						<NavLink exact to="/abou" className="nav-link" activeClassName="nav-active">
							About
						</NavLink>
					</li>
					<li className="nav-item ml-5">
						<NavLink exact to="/Crea" className="nav-link" activeClassName="nav-active">
								Create Poll
						</NavLink>
					</li>
					<li className="nav-item ml-5">
						<NavLink exact to="/Help" className="nav-link" activeClassName="nav-active">
								Help
						</NavLink>
					</li>
				</ul>	

				<NavLink to="/Logi" className="ml-auto">
					<Butt>
						Log-in
					</Butt>
				</NavLink>

				<NavLink exact to="/" className="nav-link ml-5" activeClassName="nav-active">
						Sign-up
				</NavLink>

			</Navs>
		);
	}
}
